import React, { Component } from "react";

class NrSports extends Component {
  render() {
    const { fourthbox, index } = this.props;
    return (
      <li className="nrSportsItem">
        <a className={index === 0 ? "nrSportsLinkMain" : "nrSportsLink"} href>
          {fourthbox}
        </a>
      </li>
    );
  }
}

export default NrSports;
